import React, { useState, useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { useNavigate } from "react-router-dom";
import { LoginUser } from "../features/AuthSlice";
import { useForm } from "react-hook-form";

const Login = () => {
    const {
        register,
        handleSubmit,
        formState: { errors },
    } = useForm();
    const [noHp, setNoHp] = useState("");
    const [password, setPassword] = useState("");
    const dispacth = useDispatch();
    const navigate = useNavigate();
    const { user, isError, isLoading, isSuccess, message } = useSelector(
        (state) => state.auth
    );

    const Auth = () => {
        dispacth(LoginUser({ noHp, password }));
    };

    useEffect(() => {
        if (user || isSuccess) {
            navigate("/dashboard");
        }
    }, [user, isSuccess, dispacth, navigate]);

    const background = {
        backgroundImage:
            "url(data:image/jpeg;base64,)",
        backgroundSize: "70% 100%",
        backgroundRepeat: "no-repeat",
    };

    return (
        <div style={background}>
            <section className="hero untukform is-fullheight is-fullwidth">
                <div className="hero-body">
                    <div className="container">
                        <form
                            onSubmit={Auth}
                            className="box is-pulled-right ml-3 mr-3"
                        >
                            {isError && (
                                <p
                                    className="has-text-centered"
                                    style={{
                                        color: "red",
                                        marginBottom: "5px",
                                    }}
                                >
                                    {message}
                                </p>
                            )}
                            <div className="field ">
                                <label className="label">No Hp</label>
                                <div className="control">
                                    <input
                                        {...register("noHp", {
                                            required: true,
                                        })}
                                        type="number"
                                        className="input"
                                        placeholder="0812333333"
                                        value={noHp}
                                        onChange={(e) =>
                                            setNoHp(e.target.value)
                                        }
                                    />
                                    {/* {errors.noHp?.type === "required" && (
                                        <p
                                            style={{
                                                color: "red",
                                                fontSize: "13px",
                                            }}
                                        >
                                            <i
                                                class="fa fa-exclamation-triangle"
                                                aria-hidden="true"
                                            />
                                            Tidak boleh kosong
                                        </p>
                                    )} */}
                                </div>
                            </div>
                            <div className="field">
                                <label className="label">Password</label>
                                <div className="control">
                                    <input
                                        {...register("password", {
                                            required: true,
                                        })}
                                        type="password"
                                        className="input"
                                        placeholder="**********"
                                        value={password}
                                        onChange={(e) =>
                                            setPassword(e.target.value)
                                        }
                                    />
                                    {/* {errors.password?.type === "required" && (
                                        <p
                                            style={{
                                                color: "red",
                                                fontSize: "13px",
                                            }}
                                        >
                                            <i
                                                class="fa fa-exclamation-triangle"
                                                aria-hidden="true"
                                            />
                                            Tidak boleh kosong
                                        </p>
                                    )} */}
                                </div>
                            </div>
                            <div className="field">
                                <button
                                    type="submit"
                                    className="button is-success is-fullwidth"
                                    onClick={handleSubmit(Auth)}
                                >
                                    {isLoading ? "Loading...." : "Login"}
                                </button>
                            </div>
                        </form>
                    </div>
                </div>
            </section>
        </div>
    );
};

export default Login;
